import React, { Component} from 'react';

class NewCourseForm extends Component{
    constructor(porps){
        super(porps);
        this.state={
            name:'',
            category:'',
            image:''
        }
    }
    handle
    render(){
        const{porps, state}=this;
        return(
            <form className="course-from">
                <label>
                    <span>Nome:</span>
                    <input name="name" value={state.name} />
                </label>
                <label>
                    <span>Image:</span>
                    <input name="image" value={state.image} />
                </label>
                <label>
                    <span>Categoria:</span>
                    <select name="category" value={state.category}>
                        <option value=''>Selecione</option>
                        <option value="javaScript">JavaScript</option>
                        <option value="java">java</option>
                        <option value="C#">C#</option>
                    </select>
                </label>
            </form>
        )

    }
}

export default NewCourseForm;
